function Table({ headers, data }) {
  return (
    <table>
      <thead>
        <tr>
          {headers.map((head) => (
            <th>{head}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {data.map((row) => (
          <tr>
            {headers.map((head) => (
              <td key={row.id}>{row[head]}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Table;
